import React, { useEffect, useState } from "react";

function App() {
	const [backendData, setBackendData] = useState([{}]);

	const fetchData = () => {
		fetch("/api")
			.then((response) => response.json())
			.then((data) => {
				setBackendData(data);
			});

		const data = {
			topic: "test class!",
			type: 2,
			start_time: "2022-01-17T19:00:00",
			duration: 60,
		};

		fetch("/api", {
			method: "POST",
			body: JSON.stringify(data),
		});
	};

	return (
		<div>
			<button onClick={fetchData}>fetch data</button>
		</div>
	);
}

export default App;
